Azwihangwisi Faith Muthambi is the 9th Minister of Communications of the Republic of South Africa.Muthambi had a long political career before being named the new communications minister. Some of her prominent positions include: 
*  Member of SANSCO (1989-1990); 
*  Tshimbupfe ANCYL branch Secretary (1991-1992); 
*  Executive Committee member of Tshimbupfe ANC branch (1992-1993); 
*  Deputy Secretary of the Vuwani Zone (1993-1999); 
*  REC member of Vhembe ANCYL (2003-2005); 
*  Provincial Treasurer ANCYL, Limpopo (2005-2008); 
*  ANC WL PEC member, Limpopo (2008-to-date); 
*  REC Member of the ANC Vhembe region (2006-to-date); 
*  Member of Parliament of South Africa and the Pan African Parliament (April 2009 – Present); and 
*  ANC Whip on Communication Portfolio Committee. She was one of the seven ANC MPs who were nominated for the ad hoc committee to consider President Jacob Zuma‘s submissions on the public protector’s report on his Nkandla home. Muthambi holds a B Proc from the University of Venda (1993-1996), and various other certifications and qualifications from UPTA, Wits Business School and UNIVEN.
